import { Link } from "react-router-dom";


export default function MainNavigation () {
    return(
        <header>
            <nav>
                <ul>
                    <li>
                        <Link to='/'>Home</Link>
                        <Link to={'/products'}>Products</Link>
                    </li>
                </ul>
            </nav>
        </header>
    )
}
